import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

var name = "Mẫn"
var time = new Date().getFullYear()
var custom = {
  color: red,
  fontSize: "50px"
}

ReactDOM.render(
  <div style = {custom}>
    <p>Created by {name}</p>
    <p>copyright {time} </p>
  </div>,
  document.getElementById('roots')
);

